import React from 'react';
import Container from '@material-ui/core/Container';
import '../components/About.css';


function About() {
  return (
    <div>
        <Container maxWidth="md">
        <h1>competent developer with knowledge in Python, Typescript, HTML5, CSS3, and JavaScript
             (ES5/ES6/ES7/NodeJS). Able to work with Flask, Node.js, and React frameworks. specializing in DevOps tools like Firebase, Git, Heroku, and Jupyter Notebook and databases like SQL (PostgreSQL). Notable projects include using Firebase for authentication and increasing user logins, as well as a Poke-Shop Web App using React and Flask. Professional experience includes work as a software engineer at Coding Temple in the past and as a data analyst intern at Sunfield Advisors currently, demonstrating proficiency in Flask, React, database administration, and project management.</h1>

        <p></p>
        </Container>
    </div>
  )
}

export default About
